/* eslint-disable jsx-a11y/img-redundant-alt */
/* eslint-disable jsx-a11y/alt-text */
import React from "react";

const Credit = () => {
  return (
    <div class="w-auto h-56 mt-3 bg-gradient-to-r from-blue-700 via-blue-800 to-gray-900 rounded-xl relative text-white shadow-2xl transition-transform transform hover:scale-110">
      <div class="w-full px-8 absolute top-8 text-white">
        <div class="pt-1">
          <p class="font-light">Card Number</p>
          <p id="imageCardNumber" class="font-medium tracking-more-wider h-6">
            4256 4256 4256 4256
          </p>
        </div>
        <div class="pt-6 flex justify-between">
          <div>
            <p class="font-light">Name</p>
            <p id="imageCardName" class="font-medium tracking-widest h-6">
              John Doe
            </p>
          </div>
          <div>
            <p class="font-light">Expiry</p>
            <p id="imageExpDate" class="font-medium tracking-wider h-6 w-14">
              12/24
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Credit;
